import * as types from './mutation-types'

export default {
  [types.SET_TITLE] (state, payload) {
    state.title = payload
  },
  [types.SET_DATE] (state, payload) {
    state.title = payload
  },
  [types.SET_DE] (state, payload) {
    state.title = payload
  },
  [types.SET_TITLE] (state, payload) {
    state.title = payload
  }
}
